import React from 'react';
import './prices.css';
const Prices = () => {
  return (
    <div class="container_price">
      <div class="price-block">
        <h2>Цены</h2>
        <ul>
          <li>Погладить порося: $10</li>
          <li>Погладить осла: $20</li>
          <li>Опция 3: $30</li>
        </ul>
      </div>
    </div>
  )
}

export default Prices
